import stars from '../assets/stars.png';

export default function Profile() {
  return (
    <div>
      <h2>Pancho Rodriguez</h2>
      <h4>Fullerton, CA</h4>
      <img href="" alt="" src={stars}
        style={{
          position: 'relative',
          zIndex: '2',
          display: 'block',
          margin: 'auto',
          width: '40%',
          height: '40%'
        }}
      />
      <p>test</p>
    </div>
  )
}
